import React from 'react'
import { useParams } from 'react-router-dom'

const Proyecto = () => {

    const params = useParams() ;

  return (
    <div className='page'>
      <h1 className='heading'>Proyecto: {params.id} </h1>

     
    </div>
  )
}

export default Proyecto
